<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
    
	<link rel="icon" href="../../../favicon.ico">
    <base href="../install/themes/default/">
    <title>Vvveb install</title>

    <link href="css/bootstrap.min.css" rel="stylesheet">
    <link href="css/install.css" rel="stylesheet">
    <style>
    
    </style>
  </head>
  <script>


  </script>

  <body class="h-100">



    <div id="container" class="container h-100">
		
							
			<div class="row align-items-center h-100">
				<div class="col-12 mx-auto">
		

							<img id="logo" src="http://www.vvveb.com/vvveb.png" >
								
								
								
								
								<div class="card">
									<h5 class="card-header">Page not found</h5>
								
								  <div class="card-body">
									
									<h1>The page you are looking for is not available.</h1>
									
								  </div>
								</div>
								
								
													
								<div data-debug>
									<h6>Error</h6>		
									<div class="card">
										<div class="card-body">
											<p data-v-exception-message style="white-space: pre-wrap;">Message</strong>
										</div>		
									</div>		

									<h6>File</h6>		
									<div class="card">
										<div class="card-body">
											<p data-v-exception-file>File</strong> on line <strong data-v-exception-line_no>1</strong>
										</div>
									</div>
										

									<h6>Code</h6>		
									<p data-v-exception-line></strong>
									<div class="card">
										<div class="card-body" data-v-exception-lines>
											<p data-v-exception-line style="white-space: pre-wrap;">line</strong>
										</div>
									</div>

									<!-- div class="card">
										<div class="card-body">
											<p data-v-exception-code style="white-space: pre-wrap;"></strong>
										</div>						
									</div -->						

									<h6>Trace</h6>		
									<div class="card">
										<div class="card-body">
											<p class="card-body" data-v-exception-trace style="white-space: pre-wrap;">Trace</strong>
										</div>
									</div>
								</div>
            
						
				
				</div>
			</div>
	
		

		
		
    </div>					
    
    		
  </body>
</html>
